import react from 'react'

const ProProjects = (props) => {
    console.log(props.data[0].title)
    return (
        <react.Fragment>
            Hello!
            {props.data.map((project) => {
                return (
                    <span>{project.title}</span>
                )
            })}
        </react.Fragment>
    )
}

export default ProProjects;
